import React, { Component } from 'react';
import {
  Nav,
  NavDropdown,
  MenuItem,
  Navbar,
  NavbarBrand,
  NavbarNav,
  NavbarToggler,
  Collapse,
  NavItem,
  Footer,
  NavLink,
} from 'react-bootstrap';
class NavbarHeader extends Component {
  render() {
    return (
      <div className="navbar">  
        <Navbar inverse>

            <Navbar.Brand>
              <a href="#">Student's Club</a>
            </Navbar.Brand>

        </Navbar>     
      </div>
    );
  }
}

export default NavbarHeader;
